import React, { Component } from "react";
import Navigation from "../Navbar";
import {
  Jumbotron,
  Form,
  InputGroup,
  Button,
  Col,
  Row,
  FormControl
} from "react-bootstrap";

class UserHome extends Component {
  constructor(props) {
    super();
    this.state = {};
  }

  render() {
    return (
      <div>
        <Navigation></Navigation>
        <Jumbotron>
          <h1>Who delivers your favourite food?</h1>
          <Form>
            <Form.Group as={Row} className="d-flex justify-content-center">
              <Form.Control as={Col} md="2" placeholder="Search with item">
                <i class="search icon"></i>
              </Form.Control>
              <Form.Control
                as={Col}
                md="2"
                placeholder="Search with Cuisine"
              ></Form.Control>
              <Button as={Col} md="2">
                Find Food
              </Button>
            </Form.Group>
          </Form>
          <InputGroup size="lg">
            <InputGroup.Prepend>
              <InputGroup.Text id="inputGroup-sizing-lg">Large</InputGroup.Text>
            </InputGroup.Prepend>
            <FormControl
              aria-label="Large"
              aria-describedby="inputGroup-sizing-sm"
            />
          </InputGroup>
        </Jumbotron>
      </div>
    );
  }
}

export default UserHome;
